import React, { Component } from 'react';
import axios from 'axios';
import MapView from './components/MapView';
import Menu from './components/Menu';

import './App.css';

class App extends Component {
  constructor(props) {
    super(props)
    this.state = {
      data: {
        menu: [],
        map: [],
      },
    }

    //bind functions that need a reference to this instance
    this.handleclick = this.handleclick.bind(this);
  }

  render() {
    return (
      <div className="App">
        <Menu 
          data={this.state.data.menu}
          onClick={this.handleclick}
        />
        <MapView
          data={this.state.data.map}
        />

      </div>
    );
  }

  async componentDidMount() {
    const res = await axios.get('https://nvdbapiles-v3.utv.atlas.vegvesen.no/omrader/kommuner', {headers: {'Accept': 'application/vnd.vegvesen.nvdb-v3-rev1+json'}})

    const data = res.data;
    console.log(data);
    this.setState({data: {menu: data, map: this.state.data.map}});
  }

  async handleclick(kommune) {
    console.log(kommune)
    try {
      const res = await axios.get('https://nvdbapiles-v3.utv.atlas.vegvesen.no/vegobjekter/79?inkluder=geometri,metadata&srid=4326&kommune=' + kommune, {headers: {'Accept': 'application/vnd.vegvesen.nvdb-v3-rev1+json'}})

      const data = res.data;
      console.log(data)
      this.setState({data: {menu: this.state.data.menu, map: data}});
    } catch(error) {
      if (error.response) {
        /*
         * The request was made and the server responded with a
         * status code that falls out of the range of 2xx
         */
        console.log(error.response.data);
        console.log(error.response.status);
        console.log(error.response.headers);
      }
    }
  }
}

export default App;
